import React, { Component } from 'react';
import Avatar from "@material-ui/core/Avatar";

const user = {
    name: "YEHWAN",
    mail: "azss0470@gmail.com",
}

class Account extends Component {

    render() {
        <>
            <Avatar alt={user.name} src="/broken-image.jpg"/>
        </>
    }
}

export default Account;
